import React from 'react';
import DateAndTime from './DateAndTime';
class MainContent  extends React.Component {

    render() { 
        return ( 

            <div className="content">
                <main className="main">
<DateAndTime />
                </main>
            </div>
         );
    }
}
 
export default MainContent;
